import React, { Component } from 'react';
import './App.css';

let name = 'Ryan'
let green = '#ff1212'
let headerStyle = { color: green, 'font-size': '50px' }
let defaulttextColor = '#fff';


class Filter extends Component {
  render() {
    return (
      <div style={{color: defaulttextColor}}>
        <img />
        <input type="text" /> Filter
      </div>
    )
  }
}

class Playlist extends Component {
  render(){
    return(
        <div style={{defaulttextColor}}>
          <img />
          <h3>Playlist Name</h3>
          <ul>
            <li>
              Song 1
            </li>
            <li>
              Song 2
            </li>
            <li>
              Song 3
            </li>
          </ul>
        </div>
    )
  }
}

class Aggregate extends Component {
  render() {
    return (
      <div style={{ width: '40%', color: '#ccc', display: "inline-block" }}>
        <h2>
          Number Text
        </h2>
      </div>
    )
  }
}
function App() {
  return (
    <div className="App">
      <h1 style={{ color: '#fff' }}>Title</h1>
      <Aggregate />
      <Aggregate />
      <Filter />
      <Playlist />
    </div>
  );
}

export default App;
